    false,nt"url": null,nt"notes": "This data set contains management area
    data for communities, wildlife refuges, and National, State, and regional parks
    in Cook Inlet and Kenai Peninsula, Alaska. Vector polygons in this data set represent
    management areas. Location-specific type and source information is stored in relational
    data tables (described below) designed to be used in conjunction with this spatial
    data layer. See also the SOCECON (Socioeconomic Resource Points and Lines) data
    layer, part of the larger Cook Inlet and Kenai Peninsula ESI database, for additional
    human-use information.This data set comprises a portion of the Environmental Sensitivity
    Index (ESI) data for Cook Inlet and Kenai Peninsula. ESI data characterize the marine
    and coastal environments and wildlife by their sensitivity to spilled oil. The ESI
    data include information for three main components: shoreline habitats, sensitive
    biological resources, and human-use resources.",nt"license_title": null,nt"extras":
